class App extends Component {

  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  callAPI() {
      fetch("http://104.128.95.54:9000/testAPI")
          .then(res => res.text())
          .then(res => this.setState({ apiResponse: res }))
          .then(err => err);
  }

  componentDidMount() {
      this.callAPI();
  }


  render(){
    return (
      <form  >
        <label>name:</label>
        <input className="loginName" type="text" value={this.state.apiResponse} />
        <br/>
        <label>pwsd:</label>
        <input className="loginPwsd" type="text" value={this.state.apiResponse} />
        <br/>
        <input type="submit"  />
        <BrowserRouter>
        <button>
        <Link to='/three'>666</Link>
        <Link to='/threes'>666</Link>
        <switch>
          <Route path='/three' element={<Three/>}></Route>
          <Route path='/threes' element={<Threes/>}></Route>
        </switch>
        </button>
      </BrowserRouter>

      </form>
    );
  }
}

export default App;
